import logo from './logo.svg';
import './App.css';
import React from 'react';
import WorkTable  from './components/table';

class App extends React.Component {

  constructor(props) {
    // initializing
    super(props);
    this.details = require('./details/resume.json');
  }

  componentDidMount() {
    // Setting title of page
    document.title = "Resume";
  }



  render() {
    return (
      <div className="App">
        <WorkTable details={this.details} tableName="WorkExperience" />
        <WorkTable details={this.details} tableName="Internship" />

    </div>
    );
  }
}

export default App;
